import FirebaseAuth from "../components/FirebaseAuth";
import { useUser } from "../utils/auth/useUser";
import Link from "next/link";

const Auth = () => {
  const { user, logout } = useUser();

  return (
    <div>
      <div>
        <FirebaseAuth />
      </div>
    </div>
  );
};

Auth.propTypes = {};

export default Auth;
